import React, { Component } from "react";

export default class Board extends Component {
  render() {
    const puzzle = [
      [cell, cell, cell, cell, cell, cell, cell, cell, cell],
      [cell, cell, cell, cell, cell, cell, cell, cell, cell],
      [cell, cell, cell, cell, cell, cell, cell, cell, cell],
      [cell, cell, cell, cell, cell, cell, cell, cell, cell],
    ];

    return (
      <div>
        <table className="sudoku-table">
          <tbody>
            {puzzle.map(function (line) {
              return <tr>{line}</tr>;
            })}
          </tbody>
        </table>
      </div>
    );
  }
}
